function CurrentPic({ picUrl, setIsOpen }: CurrentPicProps) {
  const [previewUrl, setPreviewUrl] = useState('');
  const [isDelete, setIsDelete] = useState(false);

  const inputRef = useRef<HTMLInputElement>(null);

  const onChangeHandler = (e: React.ChangeEvent<HTMLInputElement>) => {
    console.log('here');

    const fileReader = new FileReader();
    if (e.target.files?.length === 1) {
      fileReader.readAsDataURL(e.target.files[0]);
      fileReader.onload = function (e) {
        if (typeof e.target?.result === 'string') {
          console.log(e.target.result);

          setPreviewUrl(e.target.result);
        }
      };
    }
  };

  if (isDelete) {
    return (
      <DeletePic
        previewUrl={previewUrl}
        setPreviewUrl={setPreviewUrl}
        setIsDelete={setIsDelete}
      />
    );
  }

  if (previewUrl) {
    return <PreviewPic previewUrl={previewUrl} setPreviewUrl={setPreviewUrl} />;
  }

  return (
    <Backdrop>
      <Modal>
        <div className="header">
          <button
            onClick={() => {
              setIsOpen(false);
            }}
          >
            <Escape />
          </button>
        </div>
        <div className="body">
          <div className="img-container">
            {previewUrl ? (
              <img src={previewUrl} alt="미리보기" />
            ) : picUrl ? (
              <img src={picUrl} alt="프로필 사진" />
            ) : (
              <Profile />
            )}
          </div>
        </div>
        <div className="footer">
          <button
            onClick={() => {
              inputRef.current?.click();
              console.log('click!!', inputRef.current);
            }}
          >
            <CameraFill />
            변경
          </button>
          <button disabled={!picUrl} onClick={() => setIsDelete(true)}>
            <Delete />
            삭제
          </button>
          <input
            ref={inputRef}
            type="file"
            accept="image/*"
            onChange={onChangeHandler}
          />
        </div>
      </Modal>
    </Backdrop>
  );
}

function DefaultPic() {
  const [isOpen, setIsOpen] = useState(false);
  const [picUrl, setPicUrl] = useState(
    'data:image/gif;base64,'
  );

  return (
    <>
      {isOpen && <CurrentPic picUrl={picUrl} setIsOpen={setIsOpen} />}
      <Container>
        <div
          className="img-container"
          onClick={() => {
            setIsOpen(true);
          }}
        >
          {picUrl ? <img src={picUrl} alt={`프로필 사진`}></img> : <Profile />}
          <CameraRound />
        </div>
      </Container>
    </>
  );
}

